    def get_text_from_dialog(self, whatToInsert):
        string, _= QtWidgets.QInputDialog.getText(
            self, 'Input Dialog', f'Enter your {whatToInsert}:')
        return string

    def load_crearPas(self):
        self.stackedWidget.setCurrentIndex(3)
        self.crear_image = f.load_image("images/pasaporte_1.jpg")
        load_image(self.pasaporteImagenLabel_2, self.crear_image)


    def write_name(self):
        name = self.get_text_from_dialog("name")
        self.crear_image = f.set_name(self.crear_image, name)
        load_image(self.pasaporteImagenLabel_2, self.crear_image)
    def write_DOB(self):
        dob = self.get_text_from_dialog("date of birth")
        self.crear_image = f.set_DOB(self.crear_image, dob)
        load_image(self.pasaporteImagenLabel_2, self.crear_image)


    def write_sex(self):
        s = self.get_text_from_dialog("sex")
        self.crear_image = f.set_sex(self.crear_image, s)
        load_image(self.pasaporteImagenLabel_2, self.crear_image)

    def write_iss(self):
        iss = self.get_text_from_dialog("issuer")
        self.crear_image = f.set_issuer(self.crear_image, iss)
        load_image(self.pasaporteImagenLabel_2, self.crear_image)

    def write_exp(self):
        exp = self.get_text_from_dialog("expiration date")
        self.crear_image = f.set_expiration(self.crear_image, exp)
        load_image(self.pasaporteImagenLabel_2, self.crear_image)

    def write_id(self):
        id = self.get_text_from_dialog("ID number")
        self.crear_image = f.set_id(self.crear_image, id)
        load_image(self.pasaporteImagenLabel_2, self.crear_image)

